import React from "react";
import NavBar from "../../components/navBar";
import "../../css/main.css";

const main: React.FC = () => {
  return (
    <div className="main-screen">
      <NavBar />
      <div className="main-content">
        <h2>Bem-vindo ao Sistema Clínico</h2>
        <section className="quick-links">
          <h3>Links Rápidos</h3>
          <ul>
            <li>
              <a href="#">Agendar Consulta</a>
            </li>
            <li>
              <a href="#">Ver Resultados de Exames</a>
            </li>
            <li>
              <a href="#">Enviar Mensagem</a>
            </li>
            {/* Adicione mais links conforme necessário */}
          </ul>
        </section>
        <section className="upcoming-appointments">
          <h3>Próximas Consultas</h3>
          <p>Nome do Médico - Data e Hora</p>
          {/* Adicione mais informações sobre as próximas consultas aqui */}
        </section>
        <section className="recent-results">
          <h3>Resultados de Exames Recentes</h3>
          <p>Tipo de Exame - Data</p>
          {/* Adicione mais informações sobre os resultados de exames aqui */}
        </section>
        <section className="medical-history-summary">
          <h3>Resumo do Histórico Médico</h3>
          <p>Aqui você encontrará um resumo do seu histórico médico.</p>
        </section>
      </div>
    </div>
  );
};

export default main;
